BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "register" (
	"user_id"	INTEGER PRIMARY KEY AUTOINCREMENT,
	"user_name"	TEXT UNIQUE,
	"password"	INTEGER,
	"email"	TEXT,
	"birthday"	INTEGER,
	"city"	TEXT,
	"sex"	TEXT,
	"job"	INTEGER,
	"profile_pic"	BLOB
);
CREATE TABLE IF NOT EXISTS "user_activity" (
	"post"	TEXT,
	"user_name"	TEXT,
	"date"	INTEGER,
	"post_counter"	INTEGER,
	"user_id"	INTEGER
);
CREATE TABLE IF NOT EXISTS "numbers" (
	"post_counter"	INTEGER,
	"user_id"	INTEGER,
	FOREIGN KEY("user_id") REFERENCES "register"("user_id")
);
CREATE TABLE IF NOT EXISTS "user history" (
	"id"	INTEGER,
	"reactions"	INTEGER
);
CREATE TABLE IF NOT EXISTS "reactions table" (
	"dislike"	INTEGER NOT NULL,
	"Like"	INTEGER NOT NULL,
	"others"	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS "noti" (
	"user_id"	INTEGER NOT NULL,
	"counter"	INTEGER,
	"detils"	TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "Homepage" (
	"feed_prior"	INTEGER NOT NULL,
	"user_id"	INTEGER NOT NULL,
	"reactions"	TEXT NOT NULL,
	"posts"	TEXT,
	"post_id"	INTEGER PRIMARY KEY AUTOINCREMENT
);
COMMIT;
